     v_nro_plan_cuenta_padre, 
     v_saldo_debe, 
     v_saldo_haber, 
     v_nivel
     )
	select  0, 
			'TOTAL ACTIVOS', 
            null,
            null, 
            sum(t.v_saldo_debe), 
            sum(t.v_saldo_haber), 
            5 
	from tmp_balance_general t
    where v_nro_plan_cuenta like '1%' and v_nivel = 1 ;
     
	select * from tmp_balance_general_activos;

END ;;
