CREATE DEFINER=`web_contabilidad`@`%` PROCEDURE `balanceGeneralUtilidadGestion`()
BEGIN

	DECLARE v_id_plan_cuenta_gestion 	INT(11) ;
    DECLARE v_nro_plan_cuenta_gestion	BIGINT(20) ;
    DECLARE v_nro_plan_padre_gestion	BIGINT(20) ;
    DECLARE v_cuenta_gestion			VARCHAR(64);
    DECLARE v_saldo						DECIMAL(16,2);
	DECLARE v_saldo_monto				DECIMAL(16,2);
    DECLARE v_nivel_gestion				INT(11);

    
    -- --- --
    
	DECLARE vx_id_plan_cuenta			INT(11) ;
	DECLARE vx_cuenta					VARCHAR(40) ;
	DECLARE vx_nro_plan_cuenta			BIGINT(20) ;
	DECLARE vx_nro_plan_cuenta_padre	BIGINT(20)  ;
	DECLARE vx_saldo_debe				DECIMAL(16,2) ;
	DECLARE vx_saldo_haber				DECIMAL(16,2) ;
	DECLARE vx_nivel					INT ;
    
    DECLARE finished 					INTEGER DEFAULT 0 ;
    DECLARE finished_1 					INTEGER DEFAULT 0 ;
    
    DECLARE cur_gestion cursor for
	SELECT 
		id_plan_cuentas, 
        nro_plan_cuenta, 
        cuenta, 
        tmp.v_saldo,
        tmp.v_saldo_monto,
        pc.nivel, 
        pc.nro_plan_cuenta_padre
	from cnt_plan_cuentas pc 
	inner join tb_contabilidad_boletaje cb on cb.utilidad_gestion = pc.id_plan_cuentas
    inner join tmp_estados_resultados tmp on tmp.v_id_plan_cuenta = cb.utilidad_gestion ;

    -- --- ---- --- --- -	

    declare cur_sumas_saldos cursor for
	select 
      v_id_plan_cuenta
	, v_cuenta
    , v_nro_plan_cuenta
    , v_nro_plan_cuenta_padre
    , v_saldo_debe
    , v_saldo_haber
    , v_nivel
    from tmp_sumas_saldos pc ;
 
	declare continue handler for not found set finished_1 = 1 ;

    open cur_sumas_saldos;     
    loop_cur_sumas_saldos : loop     
		fetch cur_sumas_saldos into         
			vx_id_plan_cuenta ,
			vx_cuenta ,
			vx_nro_plan_cuenta ,
			vx_nro_plan_cuenta_padre ,
			vx_saldo_debe ,
			vx_saldo_haber,
			vx_nivel ;            
            
		insert into tmp_balance_general (
        	 v_id_plan_cuenta,
			 v_cuenta ,
			 v_nro_plan_cuenta,
			 v_nro_plan_cuenta_padre ,
			 v_saldo_debe ,
			 v_saldo_haber,
			 v_nivel
			 ) values (
             vx_id_plan_cuenta ,
			 vx_cuenta ,
			 cast(vx_nro_plan_cuenta  as char),
			 cast(vx_nro_plan_cuenta_padre as char),
			 vx_saldo_debe ,
			 vx_saldo_haber,
			 vx_nivel
             );
     
		if finished_1 = 1 then 
			leave loop_cur_sumas_saldos ;
		end if ;    
    end loop ;    
    close cur_sumas_saldos ; 
    
	set finished_1 = 0 ; 
      
    open cur_gestion ;
		loop_cur_gestion : loop          
			fetch cur_gestion into             
				v_id_plan_cuenta_gestion, 
				v_nro_plan_cuenta_gestion ,
				v_cuenta_gestion ,
				v_saldo	,
				v_saldo_monto ,
				v_nivel_gestion , 
                v_nro_plan_padre_gestion
                ;                
                
			if finished_1 = 1 then 
			leave loop_cur_gestion ;
			end if ;
            
            insert into tmp_balance_general (
        	 v_id_plan_cuenta,
			 v_cuenta ,
			 v_nro_plan_cuenta,
			 v_nro_plan_cuenta_padre ,
			 v_saldo_debe ,
			 v_saldo_haber,
			 v_nivel
			 ) values (
             v_id_plan_cuenta_gestion ,
			 v_cuenta_gestion ,
			 cast(v_nro_plan_cuenta_gestion as char) ,
			 cast(v_nro_plan_padre_gestion as char) ,
			 if(v_saldo_monto > 0 , v_saldo_monto,0  ) ,
			 if(v_saldo_monto < 0 , v_saldo_monto,0  ),
			 v_nivel_gestion
             );
        
        end loop ; 
    
    close cur_gestion ;
    
  

select * from 
(
	select  t.v_id_plan_cuenta, 
			t.v_cuenta, 
            cast(t.v_nro_plan_cuenta as char) v_nro_plan_cuenta,
            cast(t.v_nro_plan_cuenta_padre as char)v_nro_plan_cuenta_padre , 
            t.v_saldo_debe, 
            t.v_saldo_haber, 
            t.v_nivel 
	from tmp_balance_general t
    where v_nro_plan_cuenta like '1%' or v_nro_plan_cuenta like '2%'
 )  t 
 where t.v_saldo_debe <> 0.00 or t.v_saldo_haber <>0.00
order by t.v_nro_plan_cuenta, t.v_nro_plan_cuenta_padre ;

END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `estadoResultado` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
